import{_ as a}from"./_plugin-vue_export-helper.cdc0426e.js";import{o as i,c as r,f as t}from"./app.ce1b0c10.js";const e={},c=t('<h2 id="一-为什么需要-javascript-引擎" tabindex="-1"><a class="header-anchor" href="#一-为什么需要-javascript-引擎" aria-hidden="true">#</a> （一）为什么需要 JavaScript 引擎</h2><ol><li>JavaScript 是一种属于网络的高级脚本语言，高级的编程语言需要转成最终的机器指令来执行</li><li>我们编写的 JavaScript，无论交给 浏览器 或 Node 执行 ， 最后都是需要被 CPU 执行（ ps：CPU（中央处理器）：是计算机中负责读取指令，对指令译码并执行指令的核心部件）</li><li>CPU 只认识自己的指令集，即机器语言，才能被 CPU 执行</li><li>使用 JavaScript 引擎将 JavaScript 代码 翻译成 CPU 指令 来执行</li></ol><details class="custom-container details"><summary>详情</summary><p>个人理解 ： JavaScript 代码最终是由 CPU 执行的，而 CPU 只认识自己的指令集，使用 JavaScript 引擎可以将 JavaScript 代码翻译成 CPU 认识的指令集来执行</p></details><h2 id="二-常见的-javascript-引擎" tabindex="-1"><a class="header-anchor" href="#二-常见的-javascript-引擎" aria-hidden="true">#</a> （二）常见的 JavaScript 引擎</h2><ol><li>SpiderMoney ：第一款 JavaScript 引擎，由 Brendan Eich 开发 （JS 作者）</li><li>Chakra ： 微软开发</li><li>JavaScriptCore ：Webkit 中的 JavaScript 引擎，Apple 开发</li><li>V8 ： Chrome 开发</li></ol>',5),l=[c];function s(o,p){return i(),r("div",null,l)}const h=a(e,[["render",s],["__file","4-JavaScript引擎.html.vue"]]);export{h as default};
